import React, { Component } from "react";

import { View, Text, Platform, TextInput, StyleSheet } from "react-native";

export default class Home extends Component {
  static propTypes = {};

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <View>
        <Text>Szia! :)</Text>
        <button>details here</button>
      </View>
    );
  }
}

const styles = StyleSheet.create({});
